DROP TABLE IF EXISTS party.CustomersEvents;
DROP TABLE IF EXISTS party.Events;
DROP TABLE IF EXISTS party.OrdersDishes
DROP TABLE IF EXISTS party.Orders
DROP TABLE IF EXISTS party.Reservations
DROP TABLE IF EXISTS party.Customers; 
DROP TABLE IF EXISTS party.Dishes; 
DROP SCHEMA IF EXISTS party; 

EXEC('CREATE SCHEMA party');
GO

CREATE TABLE party.Dishes(
	ID int IDENTITY(1,1) NOT NULL,
	Name varchar(50) NULL,
	Description varchar(255) NULL,
	Price decimal(28, 0) NULL,
	Type varchar(50) NULL,
 CONSTRAINT PK_Dishes PRIMARY KEY (ID) 
 )

CREATE TABLE party.Customers(
	ID int IDENTITY(1,1) NOT NULL,
	FirstName varchar(20) NOT NULL,
	LastName varchar(50) NOT NULL,
	Email varchar(50) NOT NULL,
	Address varchar(40) NULL,
	City varchar(30) NULL,
	State char(2) NULL,
	Phone char(12) NULL,
	Birthday smalldatetime NULL,
	FavoriteDish int NULL,
	CONSTRAINT PK_Customers PRIMARY KEY (ID),
	CONSTRAINT FK_DishCustomers 
		FOREIGN KEY (FavoriteDish)
		REFERENCES party.Dishes(ID)
	)

CREATE TABLE party.Events(
	ID int IDENTITY(1,1) NOT NULL,
	Name varchar(50) NULL,
	Description varchar(255) NULL,
	Date smalldatetime NULL,
	Location varchar(50) NULL,
 CONSTRAINT PK_Events PRIMARY KEY (ID)
 )

CREATE TABLE party.CustomersEvents(
	ID int IDENTITY(1,1) NOT NULL,
	CustomerID int NULL,
	EventID int NULL,
 CONSTRAINT PK_CustomersEvents PRIMARY KEY (ID),
 CONSTRAINT FK_CustomersEventsCustomers 
		FOREIGN KEY (CustomerID)
		REFERENCES party.Customers(ID),
 CONSTRAINT FK_CustomersEventsEvents 
		FOREIGN KEY (EventID)
		REFERENCES party.Events(ID)
 )

CREATE TABLE party.Orders(
	ID int IDENTITY(1,1) NOT NULL,
	CustomerID int NOT NULL,
	OrderDate smalldatetime NOT NULL,
 CONSTRAINT PK_Orders PRIMARY KEY (ID),
 CONSTRAINT FK_OrdersCustomers 
		FOREIGN KEY (CustomerID)
		REFERENCES party.Customers(ID)
 )

CREATE TABLE party.OrdersDishes(
	ID int IDENTITY(1,1) NOT NULL,
	OrderID int NOT NULL,
	DishID int NOT NULL,
 CONSTRAINT PK_OrdersDishes PRIMARY KEY (ID),
 CONSTRAINT FK_OrdersDishesOrders
		FOREIGN KEY (OrderID)
		REFERENCES party.Orders(ID),
 CONSTRAINT FK_OrdersDishesDishes
		FOREIGN KEY (DishID)
		REFERENCES party.Dishes(ID)
 )

CREATE TABLE party.Reservations(
	ID int IDENTITY(1,1) NOT NULL,
	CustomerID int NOT NULL,
	Date smalldatetime NOT NULL,
	PartySize tinyint NOT NULL,
 CONSTRAINT PK_Reservations PRIMARY KEY (ID),
 CONSTRAINT FK_ReservationsCustomers 
		FOREIGN KEY (CustomerID)
		REFERENCES party.Customers(ID)
 )

