INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (1, N'Parmesan Deviled Eggs', N'These delectable little bites are made with organic eggs, fresh Parmesan, and chopped pine nuts.', CAST(80 AS Decimal(28, 0)), N'Appetizer')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (2, N'Artichokes with Garlic Aioli', N'Our artichokes are brushed with an olive oil and rosemary blend and then broiled to perfection. Served with a side of creamy garlic aioli.', CAST(90 AS Decimal(28, 0)), N'Appetizer')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (3, N'French Onion Soup', N'Caramelized onions slow cooked in a savory broth, topped with sourdough and a provolone cheese blend. Served with sourdough bread.', CAST(70 AS Decimal(28, 0)), N'Main')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (4, N'Mini Cheeseburgers', N'These mini cheeseburgers are served on a fresh baked pretzel bun with lettuce, tomato, avocado, and your choice of cheese.', CAST(80 AS Decimal(28, 0)), N'Main')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (5, N'Panko Stuffed Mushrooms', N'Large mushroom caps are filled a savory cream cheese, bacon and panko breadcrumb stuffing, topped with cheddar cheese.', CAST(70 AS Decimal(28, 0)), N'Appetizer')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (6, N'Garden Buffet', N'Choose from our fresh local, organically grown ingredients to make a custom salad.', NULL, N'Main')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (7, N'House Salad', N'Our house salad is made with romaine lettuce and spinach, topped with tomatoes, cucumbers, red onions and carrots. Served with a dressing of your choice.', CAST(70 AS Decimal(28, 0)), N'Main')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (8, N'Chef''s Salad', N'The chef''s salad has cucumber, tomatoes, red onions, mushrooms, hard-boiled eggs, cheese, and hot grilled chicken on a bed of romaine lettuce. Served with croutons and your choice of dressing.', CAST(90 AS Decimal(28, 0)), N'Main')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (9, N'Quinoa Salmon Salad', N'Our quinoa salad is served with quinoa, tomatoes, cucumber, scallions, and smoked salmon. Served with your choice of dressing.', NULL, N'Main')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (10, N'Classic Burger', N'Our classic burger is made with 100% pure angus beef, served with lettuce, tomatoes, onions, pickles, and cheese of your choice. Veggie burger available upon request. Served with French fries, fresh fruit, or a side salad.', CAST(100 AS Decimal(28, 0)), N'Main')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (11, N'Tomato Bruschetta Tortellini', N'This classic cheese tortellini is cooked in a sundried tomato sauce. Served with bruschetta topped with a tomato and basil marinara.', CAST(65 AS Decimal(28, 0)), N'Main')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (12, N'Handcrafted Pizza', N'Our thin crust pizzas are made fresh daily and topped with your choices of fresh meats, veggies, cheese, and sauce.  Price includes two toppings. Add $1 for each additional topping.', CAST(95 AS Decimal(28, 0)), N'Main')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (13, N'Barbecued Tofu Skewers', N'Our barbecued skewers include tofu, cherry tomatoes, bell peppers, and zucchini marinated in a ginger sesame sauce and charbroiled. Served with steamed rice.', NULL, N'Appetizer')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (14, N'Fiesta Family Platter', N'This platter is perfect for sharing! Enjoy our spicy buffalo wings, traditional nachos, and cheese quesadillas served with freshly made guacamole dip.', NULL, N'Main')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (15, N'Creme Brulee', N'Elegantly crafted creamy vanilla custard with a caramelized crunchy layer on top. Served with seasonal fruit.', CAST(90 AS Decimal(28, 0)), N'Dessert')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (16, N'Cheesecake', N'Our New York Style Cheesecake is rich, smooth, and creamy. Available in various flavors, and with seasonal fruit toppings.', CAST(90 AS Decimal(28, 0)), N'Dessert')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (17, N'Chocolate Chip Brownie', N'A warm chocolate chip brownie served with chocolate or vanilla ice cream and rich chocolate sauce.', CAST(60 AS Decimal(28, 0)), N'Dessert')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (18, N'Apple Pie', N'Made with local granny smith apples to bring you the freshest classic apple pie available.', CAST(50 AS Decimal(28, 0)), N'Dessert')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (19, N'Mixed Berry Tart', N'Raspberries, blueberries, and strawberries on top of a creamy filling served in a crispy tart.', CAST(70 AS Decimal(28, 0)), N'Dessert')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (20, N'Tropical Blue Smoothie', N'This blueberry mint-based smoothie is refreshing and perfect for any celebration.', CAST(60 AS Decimal(28, 0)), N'Beverage')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (21, N'Pomegranate Iced Tea', N'Our unique blend of pomegranate juice, black Rooibos, and mint tea creates this light fusion of flavors.', CAST(40 AS Decimal(28, 0)), N'Beverage')
INSERT [party].[Dishes] ([ID], [Name], [Description], [Price], [Type]) VALUES (22, N'Cafe Latte', N'Our house blend of espresso and foamed milk. Can be served with flavored syrups and over ice.  Non-dairy substitutions available upon request.', CAST(60 AS Decimal(28, 0)), N'Beverage')

